import React, { useState } from 'react';
import SearchBar from './components/SearchBar';
import SkinList from './components/SkinList';

function App() {
  const [skins, setSkins] = useState([]);

  const searchSkins = (searchTerm) => {
    // You would have your API call here, setting the skins with setSkins()
    console.log('Search for skins with term:', searchTerm);
    // setSkins(response.data); // Assuming you get data from an API response
  };

  return (
    <div className="App">
      <SearchBar onSearch={searchSkins} />
      <SkinList skins={skins} />
    </div>
  );
}

export default App;
